"use strict";
class QueriedDocs {
    constructor(query, docs) {
        this.size = 0;
        this.docs = [];
        this.empty = false;
        this.query = {};
        this.docs = docs;
        this.size = this.docs.length;
        this.empty = this.docs.length <= 0;
        this.query = query;
    }
}
module.exports = QueriedDocs;
